import React, { useState } from "react";

export default function Phonetics2(props) {
  let track = props.audio[0].audio;

  function playAudio(event) {
    event.preventDefault();
    console.log(track);
  }

  return (
    <div className='phonetic2'>
      <audio
        role='switch'
        aria-checked='false'
        data-power='on'
        onClick={playAudio}
        src={track}>
        <span>On/Off</span>
      </audio>
    </div>
  );
}
